import { useState } from "react";
import { registerStudent } from "../services/api";

const Register = () => {
  const [formData, setFormData] = useState({ name: "", rollNo: "", branch: "", email: "", phone: "", studentIdCard: null });

  const handleChange = (e) => setFormData({ ...formData, [e.target.name]: e.target.value });
  const handleFileChange = (e) => setFormData({ ...formData, studentIdCard: e.target.files[0] });

  const handleSubmit = async (e) => {
    e.preventDefault();
    const data = new FormData();
    Object.entries(formData).forEach(([key, value]) => data.append(key, value));

    await registerStudent(data);
    alert("Ticket request submitted successfully!");
  };

  return (
    <div className="max-w-md mx-auto mt-10 p-6 bg-white shadow-lg rounded-lg">
      <h2 className="text-2xl font-bold text-blue-600 mb-4">Book Your Ticket</h2>
      <form onSubmit={handleSubmit} className="space-y-4">
        <input type="text" name="name" placeholder="Name" onChange={handleChange} className="w-full p-2 border" />
        <input type="text" name="rollNo" placeholder="Roll No" onChange={handleChange} className="w-full p-2 border" />
        <input type="text" name="branch" placeholder="Branch" onChange={handleChange} className="w-full p-2 border" />
        <input type="email" name="email" placeholder="Email" onChange={handleChange} className="w-full p-2 border" />
        <input type="text" name="phone" placeholder="Phone No" onChange={handleChange} className="w-full p-2 border" />
        <input type="file" name="studentIdCard" onChange={handleFileChange} className="w-full p-2 border" />
        <button type="submit" className="bg-blue-600 text-white p-2 w-full">Submit</button>
      </form>
    </div>
  );
};

export default Register;
